import React, { Component } from "react";

class BrandList extends Component {
  render() {
    const { subcategory } = this.props;
    return (
      <li className="nrBrandItem">
        <a className="nrBrandLink" href>
          {subcategory.subTitle}
        </a>
      </li>
    );
  }
}

export default BrandList;
